       typewriter
        
       .typeString("Email Id")
         
       .pauseFor(1000)
       .deleteAll()
       .typeString("mr.shivam.work@outlook.com")
       
       .start();
       }}
  />
<h1>Full Stack Web Developer,<br /> Data Analyst, Digital Marketer</h1>
<a href="#"><Typewriter
  
       onInit={(typewriter)=> {
  
       typewriter
        
       .typeString("Email Id")
         
       .pauseFor(1000)
       .deleteAll()
       .typeString("mr.shivam.work@outlook.com")
       
       .start();
       }}
  /></a>
  
  <div className="full">
  
      <NavLink to="#" className="btn-get-started ">Download</NavLink>
 </div>
            
            
            
        
       
       
    </div>
    </div>
    <div className="col-lg-1"></div>
    <div className="col-lg-5">
        <div className="im">
        <img src={web} className="image"/>
        </div>
    </div>
</div>
</div>



        </>

    );
};

export default Intro;
